//NOTE: You may load this file as a .tst into your simulator to help debug your code.
load assembly.hack,
output-file assembly.out,
compare-to compare.cmp,
output-list RAM[0]%D2.6.2 RAM[1]%D2.6.2 RAM[2]%D2.6.2 RAM[3]%D2.6.2;

// TEST 1
set RAM[0] 12,   // Set test arguments
set RAM[1] 6;
repeat 500 {
  ticktock;
}
set RAM[0] 12,   // Restore arguments in case program used them
set RAM[1] 6,
output;
// Now we run the exact same test, but measuring for speed.
set PC 0,
set RAM[0] 12,   // Set test arguments
set RAM[1] 6,
set RAM[2] 0,
set RAM[3] 0;
while RAM[2] <> 2{
  ticktock;
}
while RAM[3] <> 0{
  ticktock;
}

// TEST 2
set RAM[0] 12,   // Set test arguments
set RAM[1] 5;
repeat 500 {
  ticktock;
}
set RAM[0] 12,   // Restore arguments in case program used them
set RAM[1] 5,
output;
// Now we run the exact same test, but measuring for speed.
set PC 0,
set RAM[0] 12,   // Set test arguments
set RAM[1] 5,
set RAM[2] 0,
set RAM[3] 0;
while RAM[2] <> 2{
  ticktock;
}
while RAM[3] <> 2{
  ticktock;
}
